import React, { useEffect, useState } from 'react';
import ShowCommunityImages from '../ShowCommunityImages/ShowCommunityImages';

const GetCommunityImages = () => {

    const [images, setImages] = useState([]);
    const [getInput, setGetInput] = useState([])

    useEffect(() => {
        fetch(`http://localhost:3002/communityImages`)
            .then(res => res.json())
            .then(data => setImages(data))
    }, [])

    // console.log(getInput);
    // images.map(image => {
    //     // const result=image.filter(singleImage=>singleImage.title.includes(getInput))
    //     // console.log(result)
    //     const result = image.filter(image.title.includes(getInput));
    //     console.log(result);
    //     console.log(image.title)
    // });
    // images.title.filter(getInput);
    console.log(images);
    return (
        <section className="services-container">
            {/* <Navbar></Navbar> */}
            <div className="text-center">
                <h1 className=" pt-2 text-info" style={{ color: '#1CC7C1' }}> OUR COMMUNITY </h1>
                {/* <h1 className="text-white mt-3">Services We Provide</h1> */}
                <div class="form-group row d-flex justify-content-center">
                    {/* <label for="inputEmail4">FirstName</label> */}
                    <input type="text" onChange={(e) => { setGetInput(e.target.value) }} class="form-control border border-primary col-md-5" placeholder="Type Here" />
                    {/* <input type="" class="form-control  col-md-6" id="inputEmail4" /> */}
                    <button type="submit" class="btn btn-primary form-control  col-md-2 ml-2"> Search </button>
                </div>
            </div>
            <div className="d-flex justify-content-center align-items-center">
                <div className="w-100 row pb-5  justify-content-center">
                    {
                        images.map(image => <ShowCommunityImages image={image}></ShowCommunityImages>)
                    }
                </div>
            </div>
        </section>
    );
};

export default GetCommunityImages;
